// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AquaGuard {
    struct Actuator {
        string actuatorType;
        bool state;
        uint256 lastUpdated;
    }

    struct Sensor {
        string sensorType;
        string value;
        uint256 lastUpdated;
    }

    struct Device {
        string serialNumber;
        address owner;
        bool isRegistered;
        mapping(string => Actuator) actuators;
        mapping(string => Sensor) sensors;
    }

    mapping(string => Device) private devices;

    event DeviceRegistered(string serialNumber, address indexed owner);
    event SensorDataLogged(string serialNumber, string sensorType, string value, uint256 timestamp);
    event ActuatorStateUpdated(string serialNumber, string actuatorType, bool state, uint256 timestamp);

    modifier onlyOwner(string memory serialNumber) {
        require(devices[serialNumber].owner == msg.sender, "Not authorized");
        _;
    }

    function registerDevice(string memory serialNumber) public {
        require(!devices[serialNumber].isRegistered, "Device already registered");

        Device storage newDevice = devices[serialNumber];
        newDevice.serialNumber = serialNumber;
        newDevice.owner = msg.sender;
        newDevice.isRegistered = true;

        emit DeviceRegistered(serialNumber, msg.sender);
    }

    function logSensorData(
        string memory serialNumber,
        string memory sensorType,
        string memory value
    ) public onlyOwner(serialNumber) {
        require(devices[serialNumber].isRegistered, "Device not registered");

        Sensor storage sensor = devices[serialNumber].sensors[sensorType];
        sensor.sensorType = sensorType;
        sensor.value = value;
        sensor.lastUpdated = block.timestamp;

        emit SensorDataLogged(serialNumber, sensorType, value, block.timestamp);
    }

    function updateActuatorState(
        string memory serialNumber,
        string memory actuatorType,
        bool state
    ) public onlyOwner(serialNumber) {
        require(devices[serialNumber].isRegistered, "Device not registered");

        Actuator storage actuator = devices[serialNumber].actuators[actuatorType];
        actuator.actuatorType = actuatorType;
        actuator.state = state;
        actuator.lastUpdated = block.timestamp;

        emit ActuatorStateUpdated(serialNumber, actuatorType, state, block.timestamp);
    }

    function getSensorData(string memory serialNumber, string memory sensorType)
        public
        view
        returns (string memory value, uint256 lastUpdated)
    {
        require(devices[serialNumber].isRegistered, "Device not registered");

        Sensor storage sensor = devices[serialNumber].sensors[sensorType];
        return (sensor.value, sensor.lastUpdated);
    }

    function getActuatorState(string memory serialNumber, string memory actuatorType)
        public
        view
        returns (bool state, uint256 lastUpdated)
    {
        require(devices[serialNumber].isRegistered, "Device not registered");

        Actuator storage actuator = devices[serialNumber].actuators[actuatorType];
        return (actuator.state, actuator.lastUpdated);
    }
}
